export function DefaultScale(){return 8.0}
export function ControllableParameters(){
    return [
        {"property":"shutdownColor", "label":"Shutdown Color","type":"color","default":"009bde"},
        {"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas","Forced"], "default":"Canvas"},
        {"property":"forcedColor", "label":"Forced Color","type":"color","default":"009bde"},
        {"property":"DpiControl", "label":"Enable Dpi Control","type":"boolean","default":"false"},
        {"property":"dpi1", "label":"DPI", "type":"number","min":"200", "max":"12400","default":"800"},
    ];
}
var savedDpi1;

var vLedNames = ["Left Zone", "Logo Zone", "Right Zone"];
var vLedPositions = [
    [0,1],[1,2],[2,1]
];

export function LedNames()
{
    return vLedNames;
}

export function LedPositions()
{
    return vLedPositions;
}


export function Initialize()
{
if(savedDpi1 != dpi1 && DpiControl) {
        setDpi(dpi1);
    
}
}

function setDpi(dpi){

    device.set_endpoint(1, 0x0001, 0xff00); // System IF    
    savedDpi1 = dpi1;

    var packet = [];
    packet[0] = 0x10;
    packet[1] = 0xFF;
    packet[2] = 0x0A;
    packet[3] = 0x3A;
    packet[4] = 0x00;
    packet[5] = Math.floor(dpi/256);
    packet[6] = dpi%256;
    device.write(packet, 7);



}
function Apply()
{
    var packet = [];

    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x12;
    packet[0x03] = 0x7E;

    device.write(packet, 20);  
    device.pause(30);  
    //device.read(packet,20);
}
function sendColor(shutdown = false){
    device.set_endpoint(1, 0x0002, 0xff00); // Lighting IF    

    var packet = [];

    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x12;
    packet[0x03] = 0x1E;

    var offset = 4;
    for (var iIdx = 0; iIdx < vLedPositions.length; iIdx++)
    {
        var iLedIdx = offset + (iIdx * 4);
        var iX = vLedPositions[iIdx][0];
        var iY = vLedPositions[iIdx][1];
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iX, iY);
        }        
        packet[iLedIdx] = iIdx + 1;
        packet[iLedIdx+1] = color[0];
        packet[iLedIdx+2] = color[1];
        packet[iLedIdx+3] = color[2];
    }
    
    packet[0x10] = 0xFF;

    device.write(packet, 20);
    device.pause(30);
    
    Apply();
}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }
export function Render()
{
    sendColor()

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
      }

}


export function Shutdown()
{
    sendColor(true)

}


export function Validate(endpoint)
{
    return endpoint.interface === 1 && endpoint.usage === 0x0002 && endpoint.usage_page === 0xff00
     || endpoint.interface === 1 && endpoint.usage === 0x0001 && endpoint.usage_page === 0xff00;
}

